import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 20, height: 20, viewBox: "0 0 20 20", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M11 8a.5.5 0 010 1H6a.5.5 0 010-1h5z", fill: primaryFill }),
        React.createElement("path", { d: "M14 8.5a5.5 5.5 0 10-1.98 4.23l4.13 4.12.07.06a.5.5 0 00.63-.76l-4.12-4.13A5.48 5.48 0 0014 8.5zm-10 0a4.5 4.5 0 119 0 4.5 4.5 0 01-9 0z", fill: primaryFill }));
};
const ZoomOut20Regular = wrapIcon(rawSvg({}), 'ZoomOut20Regular');
export default ZoomOut20Regular;
